$('.teilnehmer').each(function (index, member) {
  console.log(parseMember(member));
})

function parseMember (member) {
  var $member = $(member);
  var entry = {};

  // Parse name
  entry.name = $member.find('[itemprop="name"]').text();

  // Parse address
  entry.address = $member.find('[itemprop="streetAddress"]').text();

  // Parse postal code
  entry.postalCode = $member.find('[itemprop="postalCode"]').text();

  // Parse locality
  entry.locality = $member.find('[itemprop="addressLocality"]').text();

  // Parse branch
  entry.branch = $member.find('.branchen span').text();

  // Parse additional info
  entry.additionalInfo = $member.find('.gebuehreninformation').text();

  // Parse telephone number
  entry.phone = parsePhone($member);

  // Parse email
  entry.email = $member.find('.email .text').text();

  // Parse website
  entry.website = $member.find('.website .text').text();

  return entry;
}


function parsePhone($member){
  var phoneNumber = $member.find('.phone .suffix').text();

  var matches = phoneNumber.match(/^([^-]+)/);
  return matches[1];
}
